import React from "react";

function FilterLine(props) {
  return (
    <div>
      <input
        type="checkbox"
        onChange={() => {
          setCheck(!isChecked);
          props.onChange({ target: [isChecked, props.text] });
        }}
      />
      {props.text}
    </div>
  );
}

export default FilterLine;
